    false,nt"url": null,nt"notes": "The Geological Collections at Scripps Institution
    of Oceanography are a physical library of priceless geological samples that come
    from the seafloor and subseafloor of the world?s oceans. The Scripps Core Collection
    contains nearly 7,000 cores (15,000 refrigerated core sections) collected using
    gravity, piston, trigger, vibra- and box-coring techniques. It is the largest collection
    in the U.S. (outside that of the Ocean Drilling Program) of sediments from the Pacific
    Ocean and also contains extensive material from the other major ocean basins. The
    collection contains cores that were collected using gravity, piston, trigger, vibra-
    and box-coring techniques. Dredged rocks in the collection consist of more than
    4,000 dredge hauls and related archive materials. SIO is a partner in the Index
    to Marine and Lacustrine Geological Samples (IMLGS) database. As a partner repository,
    SIO sends data and information related to the SIO sample collection to NCEI for
    long-term archive, and for discoverability via the IMLGS.",nt"license_title":
